import Link from "next/link";
import useSWR from "swr";
export default function Index() {
  const data = fetch("./api/test.js")
    .then(r => r.text())
    .catch(console.log);

  return (
    <>
      <h1>Response: {data}</h1>
      <Link href="/about">
        <a>Go to About!</a>
      </Link>
    </>
  );
}
